import React from "react";
import Card from "../Components/Card/Card";
import { useCharStates } from "../Components/utils/global.context";

const Home = () => {
  const { state } = useCharStates();

  return (
    <div>
      {state.list.map(item => <Card key={item.id} item={item} />)}
    </div>
  )
}

export default Home

